vOpen1() ; DISTINCT COLUMN FROM SYSMAPLITDTA WHERE TABLE='CUVAR'
 ;
 ;
 S vOid=$G(^DBTMP($J))-1,^($J)=vOid K ^DBTMP($J,vOid)
 S vos1=2
 D vL1a1
 Q ""
 ;
vL1a0 S vos1=0 Q
vL1a1 S vos2=$$BYTECHAR^SQLUTL(254)
 S vos3=""
vL1a3 S vos3=$O(^SYSMAP("LITDATA",vos3),1) I vos3="" G vL1a9
 S vos4=""
vL1a5 S vos4=$O(^SYSMAP("LITDATA",vos3,"CUVAR",vos4),1) I vos4="" G vL1a3
 S vd=$S(vos4=vos2:"",1:vos4)
 S ^DBTMP($J,vOid,1,vos4)=vd
 G vL1a5
vL1a9 S vos2=""
vL1a10 S vos2=$O(^DBTMP($J,vOid,1,vos2),1) I vos2="" G vL1a0
 Q
 ;
vFetch1() ;
 ;
 ;
 I vos1=1 D vL1a10
 I vos1=2 S vos1=1
 ;
 I vos1=0 S rslits="" K ^DBTMP($J,vOid) Q 0
 ;
 S rslits=^DBTMP($J,vOid,1,vos2)
 ;
 Q 1
